var kk = {
    margin : "-10px"
        }
class Home extends Component {

    render() {
        return  (<div><center> <img src="index.png" width="30" height="30" style={kk}/> &nbsp;&nbsp;&nbsp; Instagram &nbsp; &nbsp; &nbsp;&nbsp;
        <input type="text" placeholder="search"/> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
        <a href="" ><img src="images.png" width="30" height="30" style={kk}/></a> </center>
        </div>);
    }
}

export default Home;
